import PersistanceManager from "../../persistance/PersistanceManager";

class Pratica {
    #id;
    #titolo;
    #descrizione;
    #prg_pratica;
    #user_name;
    #nome;

    constructor (data) {
        this.#id = data['id'];
        this.#titolo = data['titolo'];
        this.#descrizione = data['descrizione'];
        this.#prg_pratica = data['prg_pratica'];
        this.#user_name = data['user_name'];
        this.#nome = data['nome'];
    }

    getId() {
        return this.#id;
    }

    getTitolo() {
        return this.#titolo;
    }

    getDescrizione() {
        return this.#descrizione;
    }

    getPrgPratica() {
        return this.#prg_pratica;
    }

    getUserName() {
        return this.#user_name;
    }

    getNome() {
        return this.#nome;
    }

    static async loadPratiche() {
        const ret = await PersistanceManager.doGet('loadpratiche.php?username=m.toselli'); // da cambiare con l'email che è stata utilizzata per il login

        if (ret['error']) {
            // devo gestire il caso di errore
        }
        let retlist = [];
        
        for (let iter of ret['pratiche']) {
            retlist.push(new Pratica(iter));
        }

        return retlist;
    }

    toString() {
        return 'id: ' + this.#id + '\ntitolo: ' + this.#titolo + '\ndesc: ' + this.#descrizione +
            '\nuser: ' + this.#user_name + '\nnome: ' + this.#nome;
    }

}

export default Pratica;
